"""## Step 2. Enter the URL Name like so:

1. add 'json.' where 'www' should be
2. add 'pages/' between '.com' and the /subdirectoy (for eg, '/commander')
3. add '.json.' at the end of the url.

> For Example:  
Say, this is the deck you want to export:  
https://edhrec.com/commanders/kaalia-of-the-vast  
you need to change it to:  
https://json.edhrec.com/pages/commanders/kaalia-of-the-vast.json
"""

json_url = input("Enter EDHREC JSON URL: ").strip()

"""### Press enter and you're done! The file should download automatically. You can then add the card names into archidekt through their import feature.
> note: I am not sure if it imports the number of cards yet since I have only used this for commander decks.   
You can ignore the rest of the script.
"""

response = requests.get(json_url)
if response.status_code != 200:
    raise Exception(f"Failed to fetch JSON. Status code: {response.status_code}")

data = response.json()

def extract_card_names(obj):
    names = []
    if isinstance(obj, dict):
        for key, value in obj.items():
            if key == 'name' and isinstance(value, str):
                names.append(value)
            else:
                names.extend(extract_card_names(value))
    elif isinstance(obj, list):
        for item in obj:
            names.extend(extract_card_names(item))
    return names

card_names = extract_card_names(data)

ignore_keywords = ["Article", "Commander", "Deck", "View", "Links"]
filtered_names = [name for name in card_names if not any(word in name for word in ignore_keywords)]

unique_card_names = list(dict.fromkeys(filtered_names))

"""## Save to File"""

output_file = "card_names.txt"
with open(output_file, 'w', encoding='utf-8') as f:
    for name in unique_card_names:
        f.write(name + '\n')

print(f"Extracted {len(unique_card_names)} card names. Saved to {output_file}.")
print("\First 20 cards:")
print("\n".join(unique_card_names[:20]))  # first 20 names

from google.colab import files
files.download(output_file)

